import React, { useState } from "react"
import { useTranslation, withTranslation } from "react-i18next"
import PropTypes from 'prop-types';

import {
  Row,
  Col,
  Button,
  Label,
  Input,
  Modal,
  Card,
  CardBody,
  CardFooter,
  InputGroup,
} from "reactstrap"

import { AvForm, AvField, AvGroup } from "availity-reactstrap-validation"


const ModalAnalisisCredito = (props) => {
  const { t, i18n } = useTranslation();
  // Submitimos formulario para busqueda de clientes
  function handleSubmit(event, errors, values) {
    event.preventDefault();
    if (errors.length > 0) {
      return;
    }
    // {
    //   "transactId": 0,
    //   "description": "",
    //   "useInMiles": 0,
    //   "shareholder": "",
    //   "bank": ""
    // }
    props.dataManagement(values)
  }


  return (
    <Modal
      size="xl"
      isOpen={props.isOpen}
      toggle={props.toggle}
      centered={true}>
      <div className="modal-header">
        <h5 className="modal-title mt-0">{props.titulo}</h5>
        <button
          type="button"
          onClick={props.toggle}
          data-dismiss="modal"
          className="close"
          aria-label="Close">
          <span aria-hidden="true">&times;</span>
        </button>
      </div>
      <div className="modal-body" style={{ backgroundColor: "#f3f5f7" }}>

        <Row>
          <Col xl="12">
            <AvForm id="frmSearch" className="needs-validation" onSubmit={handleSubmit}>
              <Card>
                <CardBody>
                  <Row>
                    <Col md="8">
                      <div className="mb-3">
                        <Label htmlFor="itemActive">{t("Description")}</Label>
                        <AvField
                          className="form-control"
                          type="textarea"
                          name="itemActive"
                          validate={{
                            required: { value: true, errorMessage: t("Required") },
                          }}
                          value={props.tipo == "BalanceActivo"||props.tipo == "EBalanceActivo" ? props.dataSet.activoitem : (props.tipo == "BalancePasivo"||props.tipo == "EBalancePasivo" ? props.dataSet.itemPassive : (props.tipo == "OrigenAplicacionn"||props.tipo == "EOrigenAplicacionn" ? props.dataSet.sourceApplicationItem : props.dataSet.itemIndicators))}
                          id="itemActive"
                        />
                      </div>
                    </Col>
                    <Col md="4">
                      <div className="mb-3">
                        <Label htmlFor="presentYear">{t("CurrentYear")}</Label>
                        <AvField
                          className="form-control"
                          type="number"
                          name="presentYear"
                          validate={{
                            required: { value: true, errorMessage: t("Required") },
                            number: { value: true, errorMessage: t("invalidfield") },
                          }}
                          value={props.tipo == "BalanceActivo"||props.tipo == "EBalanceActivo" ? props.dataSet.anioactual:props.dataSet.presentYear}
                          id="presentYear"
                        />
                      </div>
                    </Col>
                  </Row>
                  <Row>
                    <Col md="6">
                      <div className="mb-3">
                        <Label htmlFor="year1">1 {t("YearAgo")}</Label>
                        <AvField
                          className="form-control"
                          type="number"
                          name="year1"
                          validate={{
                            required: { value: true, errorMessage: t("Required") },
                            number: { value: true, errorMessage: t("invalidfield") },
                          }}
                          value={props.tipo == "BalanceActivo"||props.tipo == "EBalanceActivo" ? props.dataSet.anio1:props.dataSet.year1}
                          id="year1"
                        />
                      </div>
                    </Col>
                    <Col md="6">
                      <div className="mb-3">
                        <Label htmlFor="year2">2 {t("YearAgo")}</Label>
                        <AvField
                          className="form-control"
                          type="number"
                          name="year2"
                          validate={{
                            required: { value: true, errorMessage: t("Required") },
                            number: { value: true, errorMessage: t("invalidfield") },
                          }}
                          value={props.tipo == "BalanceActivo"||props.tipo == "EBalanceActivo" ? props.dataSet.anio2:props.dataSet.year2}
                          id="year2"
                        />
                      </div>
                    </Col>
                  </Row>
                  <Row>
                    <Col md="6">
                      <div className="mb-3">
                        <Label htmlFor="year3">3 {t("YearAgo")}</Label>
                        <AvField
                          className="form-control"
                          type="number"
                          name="year3"
                          validate={{
                            required: { value: true, errorMessage: t("Required") },
                            number: { value: true, errorMessage: t("invalidfield") },
                          }}
                          value={props.tipo == "BalanceActivo"||props.tipo == "EBalanceActivo" ? props.dataSet.anio3:props.dataSet.year3}
                          id="year3"
                        />
                      </div>
                    </Col>
                    <Col md="6">
                      <div className="mb-3">
                        <Label htmlFor="year4">4 {t("YearAgo")}</Label>
                        <AvField
                          className="form-control"
                          type="number"
                          name="year4"
                          validate={{
                            required: { value: true, errorMessage: t("Required") },
                            number: { value: true, errorMessage: t("invalidfield") },
                          }}
                          value={props.tipo == "BalanceActivo"||props.tipo == "EBalanceActivo" ? props.dataSet.anio4:props.dataSet.year4}
                          id="year4"
                        />
                      </div>
                    </Col>
                  </Row>
                </CardBody>
                <CardFooter style={{ textAlign: "right" }}>

                  <Button id="btnNew" color="dark" type="button" style={{ margin: '5px' }} onClick={props.toggle} data-dismiss="modal">
                    <i className="mdi mdi mdi-cancel mid-12px"></i>{" "}{t("Cancel")}
                  </Button>
                  {props.botones ?
                    <Button id="btnSearch" color="success" type="submit" style={{ margin: '5px' }}><i className="mdi mdi-content-save mdi-12px"></i>
                      {" "} {props.tipo == "BalanceActivo" || props.tipo == "BalancePasivo" || props.tipo == "OrigenAplicacionn" || props.tipo == "indicadores" ? t("Save") : t("Edit")}
                    </Button> : null}
                </CardFooter>
              </Card>
            </AvForm>
          </Col>
        </Row>
      </div>
    </Modal>
  );
};

ModalAnalisisCredito.propTypes = {
  isOpen: PropTypes.bool,
  toggle: PropTypes.func
};

export default ModalAnalisisCredito;
